    <script>
      function getScript(e, i) {
        var n = document.createElement("script");
        (n.type = "text/javascript"),
          (n.async = !0),
          i && (n.onload = i),
          (n.src = e),
          document.head.appendChild(n);
      }
      function parseMessage(e) {
        var i = e.data,
          n = i.indexOf(DOLLAR_PREFIX + RECEIVE_MSG_PREFIX);
        if (-1 !== n) {
          var t = i.slice(n + 2);
          return getMessageParams(t);
        }
        return {};
      }
      function getMessageParams(e) {
        var i,
          n = [],
          t = e.split("/"),
          a = t.length;
        if (-1 === e.indexOf(RECEIVE_MSG_PREFIX)) {
          if (a >= 2 && a % 2 === 0)
            for (i = 0; a > i; i += 2)
              n[t[i]] = t.length < i + 1 ? null : decodeURIComponent(t[i + 1]);
        } else {
          var o = e.split(RECEIVE_MSG_PREFIX);
          void 0 !== o[1] && (n = JSON && JSON.parse(o[1]));
        }
        return n;
      }
      function getDapi(e) {
        var i = parseMessage(e);
        if (!i || i.name === GET_DAPI_URL_MSG_NAME) {
          var n = i.data;
          getScript(n, onDapiReceived);
        }
      }
      function invokeDapiListeners() {
        for (var e in dapiEventsPool)
          dapiEventsPool.hasOwnProperty(e) &&
            dapi.addEventListener(e, dapiEventsPool[e]);
      }
      function onDapiReceived() {
        (dapi = window.dapi),
          window.removeEventListener("message", getDapi),
          invokeDapiListeners();
      }
      function init() {
        window.dapi.isDemoDapi &&
          (window.parent.postMessage(
            DOLLAR_PREFIX +
              SEND_MSG_PREFIX +
              JSON.stringify({ state: "getDapiUrl" }),
            "*"
          ),
          window.addEventListener("message", getDapi, !1));
      }
      var DOLLAR_PREFIX = "$$",
        RECEIVE_MSG_PREFIX = "DAPI_SERVICE:",
        SEND_MSG_PREFIX = "DAPI_AD:",
        GET_DAPI_URL_MSG_NAME = "connection.getDapiUrl",
        dapiEventsPool = {},
        dapi = window.dapi || {
          isReady: function () {
            return !1;
          },
          addEventListener: function (e, i) {
            dapiEventsPool[e] = i;
          },
          removeEventListener: function (e) {
            delete dapiEventsPool[e];
          },
          isDemoDapi: !0,
        };
      init();
    </script>

    <script>
      window.onload = function () {
        dapi.isReady()
          ? onReadyCallback()
          : dapi.addEventListener("ready", onReadyCallback);
        //here you can put other code that not related to dapi logic
      };

      function onReadyCallback() {
        //no need to listen to this event anymore
        dapi.removeEventListener("ready", onReadyCallback);
        let isAudioEnabled = !!dapi.getAudioVolume();

        if (dapi.isViewable()) {
          adVisibleCallback({ isViewable: true });
        }

        dapi.addEventListener("viewableChange", adVisibleCallback);
        dapi.addEventListener("adResized", adResizeCallback);
        dapi.addEventListener("audioVolumeChange", audioVolumeChangeCallback);
        class CharacterPart extends Phaser.GameObjects.Sprite {
          constructor(scene, character, part, x, y) {
            super(scene, x, y, "characters", `char${character}_0${part}.png`);
            console.log();
            this.init();
          }

          init() {
            this.scene.add.existing(this);
          }

          swipe(direction, onComplete = () => {}) {
            if (direction)
              this.scene.tweens.add({
                targets: this,
                x:
                  direction === "right"
                    ? this.x + this.scene.cameras.main.width
                    : this.x - this.scene.cameras.main.width,
                ease: "Linear",
                duration: 300,
                onComplete,
              });
          }
        }

        function binaryStringToArrayBuffer(binary) {
          var length = binary.length;
          var buf = new ArrayBuffer(length);
          var arr = new Uint8Array(buf);
          var i = -1;
          while (++i < length) {
            arr[i] = binary.charCodeAt(i);
          }
          return buf;
        }

        function createBlob(parts, properties) {
          parts = parts || [];
          properties = properties || {};
          if (typeof properties === "string") {
            properties = { type: properties }; // infer content type
          }
          try {
            return new Blob(parts, properties);
          } catch (e) {
            if (e.name !== "TypeError") {
              throw e;
            }
            var Builder =
              typeof BlobBuilder !== "undefined"
                ? BlobBuilder
                : typeof MSBlobBuilder !== "undefined"
                ? MSBlobBuilder
                : typeof MozBlobBuilder !== "undefined"
                ? MozBlobBuilder
                : WebKitBlobBuilder;
            var builder = new Builder();
            for (var i = 0; i < parts.length; i += 1) {
              builder.append(parts[i]);
            }
            return builder.getBlob(properties.type);
          }
        }

        function base64StringToBlob(base64, type) {
          var parts = [binaryStringToArrayBuffer(atob(base64))];
          return type ? createBlob(parts, { type: type }) : createBlob(parts);
        }

        class PreloadScene extends Phaser.Scene {
          constructor() {
            super("Preload");
            this.atlasLoaded = false;
          }

          loadBase64Atlas(key, data, json) {
            const imageElement = new Image();

            const spriteBlob = base64StringToBlob(
              data.split(",")[1],
              "image/png"
            );
            imageElement.src = URL.createObjectURL(spriteBlob);
            imageElement.onload = () => {
              this.textures.addAtlas(key, imageElement, json);
              this.atlasLoaded = true;
              // this.onAssetLoaded();
            };
          }

          update() {
            if (this.atlasLoaded) {
              this.scene.start("Tutorial");
            }
          }

        class BaseGameScene extends Phaser.Scene {
          start = false;
          constructor(name) {
            super(name);
            this.facePositions = [];
            this.swipesLeft = 1;
          }

          preload() {
            this.load.scenePlugin(
              "rexgesturesplugin",
              "https://raw.githubusercontent.com/rexrainbow/phaser3-rex-notes/master/dist/rexgesturesplugin.min.js",
              "rexGestures",
              "rexGestures"
            );
            console.log(this.plugins);
          }

          create() {
            this.createBackground();
            this.createParts();
            this.addSwipeBehavior();
          }

          addSwipeBehavior() {
            this.swipeInput = this.rexGestures.add
              .swipe({ velocityThreshold: 1000, dir: "left&right" })
              .on("swipe", this.swipeHandler, this);
          }

          swipeHandler({ lastPointer: { downY }, left, right }) {
            let swipedPart = null;
            this.facePositions.forEach(({ start, end }, index) => {
              if (start <= downY && end >= downY) swipedPart = index;
            });
            if (typeof swipedPart === "number") {
              const direction = right ? "right" : left ? "left" : null;
              this.facePositions[swipedPart].parts.forEach(
                ({ part, index }) => {
                  part.swipe(direction);
                }
              );
              setTimeout(() => {
                this.reorganizeParts(swipedPart, direction);
                --this.swipesLeft;
              }, 350);
            }
          }

          reorganizeParts(swipedPart, direction) {
            if (direction === "right") {
              const { parts } = this.facePositions[swipedPart];
              const last = parts.pop();
              last.part.setX(this.cameras.main.width * -3.5);
              parts.unshift(last);
            } else if (direction === "left") {
              const { parts } = this.facePositions[swipedPart];
              const first = parts.shift();
              first.part.setX(this.cameras.main.width * 2.5);
              parts.push(first);
            }
          }

          createBackground() {
            this.createLighting();
            this.createWall();
            this.createBankRobber();
          }

          getScale(image, coeff = 1, cover = true, dimension = null) {
            const scaleX = this.cameras.main.width / image.width;
            const scaleY = this.cameras.main.height / image.height;
            if (dimension === "x") {
              return scaleX * coeff;
            } else if (dimension === "y") {
              return scaleY * coeff;
            } else {
              const mathFunc = cover ? Math.max : Math.min;
              return mathFunc(scaleX, scaleY) * coeff;
            }
          }

          createLighting() {
            this.background = this.add.image(
              this.cameras.main.width / 2,
              this.cameras.main.height / 2,
              "lighting"
            );
            const scale = this.getScale(this.background, 1.5, false, "x");
            this.background.setScale(scale).setScrollFactor(0);
          }

          createWall() {
            this.wall = this.add.image(this.cameras.main.width / 2, 0, "wall");
            this.scale = this.getScale(this.wall, 1.1, false);
            this.wall.setScale(this.scale).setScrollFactor(0);
            this.wall.setY(
              this.cameras.main.height -
                (this.wall.height * this.wall.scale) / 3
            );
          }

          createBankRobber() {
            this.bankRobber = this.add.image(
              this.cameras.main.width / 2,
              0,
              "bankrobber"
            );
            this.bankRobber.setScale(this.scale * 0.3).setScrollFactor(0);
            this.bankRobber.setY(
              (this.bankRobber.height * this.bankRobber.scale) / 1.5
            );
          }

          shuffle(array) {
            let currentIndex = array.length;
            while (currentIndex != 0) {
              const randomIndex = Math.floor(Math.random() * currentIndex);
              currentIndex--;
              [array[currentIndex], array[randomIndex]] = [
                array[randomIndex],
                array[currentIndex],
              ];
            }
            return array;
          }

          createFacePartStripe(yIndex, xIndex, characterIndex) {
            const char = new CharacterPart(
              this,
              characterIndex,
              5 - yIndex,
              this.cameras.main.width * (xIndex - 4.5),
              0
            );
            char.setScale(this.scale * 0.8);
            char.y =
              this.cameras.main.height - char.height * char.scale * yIndex;
            this.facePositions[yIndex - 1].parts.push({
              index: characterIndex,
              part: char,
            });
          }

          createParts() {
            for (let yIndex = 1; yIndex < 5; yIndex++) {
              this.facePositions.push({ start: null, end: null, parts: [] });
              const currentPosition = this.facePositions[yIndex - 1];
              const shuffled = this.shuffle([1, 2, 3, 4, 5, 6, 7]);
              console.log(shuffled);
              shuffled.forEach((characterIndex, xIndex) =>
                this.createFacePartStripe(yIndex, xIndex + 1, characterIndex)
              );
              const { parts } = this.facePositions[yIndex - 1];
              const { part } = parts[0];
              const height = part.height * part.scale;
              currentPosition.start =
                this.cameras.main.height - height * (yIndex + 0.5);
              currentPosition.end =
                this.cameras.main.height - height * (yIndex - 0.5);
            }
          }
        }
        class TutorialScene extends BaseGameScene {
          constructor() {
            super("Tutorial");
            this.tutorial = true;
          }

          create() {
            this.createLighting();
            this.createWall();
            this.addBlur();
            this.createBankRobber();
            this.createTitle();
            this.addButton();
            this.createParts();
            this.hideParts();
          }

          createBankRobber() {
            this.bankRobber = this.add.image(
              this.cameras.main.width / 2,
              this.cameras.main.height * -0.2,
              "bankrobber"
            );
            this.bankRobber.setScale(this.scale * 0.3).setScrollFactor(0);
            this.tweens.add({
              targets: this.bankRobber,
              y: (this.bankRobber.height * this.bankRobber.scale) / 1.5,
              angle: 0,
              ease: "Back",
              duration: 1000,
            });
          }

          update() {
            if (this.swipesLeft <= 0 && this.tutorial) {
              this.tutorial = false;
              this.endOfTutorial();
            }
          }

          addBlur() {
            const rectangle = this.add
              .rectangle(
                0,
                0,
                this.cameras.main.width,
                this.cameras.main.height,
                "black"
              )
              .setOrigin(0, 0)
              .setAlpha(0);

            this.tweens.add({
              targets: rectangle,
              alpha: 0.8,
              ease: "Linear",
              duration: 500,
            });
          }

          addFinger() {
            this.finger = this.add
              .image(
                this.cameras.main.width / 2,
                -(this.cameras.main.height / 6),
                "finger"
              )
              .setAngle(45);
            const scale = this.getScale(this.finger, 0.3, false);
            this.finger.setScale(scale).setScrollFactor(0);
            this.tweens.add({
              targets: this.finger,
              x: this.finger.width * this.finger.scale,
              y: this.cameras.main.height / 6,
              angle: 0,
              ease: "Back",
              duration: 500,
              delay: 500,
              onComplete: () => this.swipeFinger(),
            });
          }

          swipeFinger() {
            this.tweens.add({
              targets: this.finger,
              x: 0,
              y: this.cameras.main.height / 1.5,
              angle: -45,
              ease: "Back",
              duration: 500,
              delay: 500,
              onComplete: () =>
                this.tweens.add({
                  targets: this.finger,
                  angle: 45,
                  x: this.cameras.main.width / 2,
                  ease: "Linear",
                  duration: 500,
                  yoyo: true,
                  onComplete: () =>
                    this.tweens.add({
                      targets: this.finger,
                      x: this.cameras.main.width / 4,
                      angle: 0,
                      ease: "Linear",
                      duration: 500,
                      onComplete: () => this.enableSwipe(),
                    }),
                }),
            });
          }
          forEachPart(handler) {
            this.facePositions.forEach(({ parts }) =>
              parts.forEach(({ part }) => handler(part))
            );
          }

          hideParts() {
            this.forEachPart((part) => part.setAlpha(0));
          }

          showParts() {
            this.forEachPart((part) =>
              this.tweens.add({
                targets: part,
                alpha: 1,
                ease: "Linear",
                duration: 1000,
              })
            );
          }

          fadeParts() {
            this.forEachPart((part) =>
              this.tweens.add({
                targets: part,
                alpha: 0,
                ease: "Linear",
                duration: 1000,
              })
            );
          }

          createTitle() {
            this.title = this.add
              .sprite(
                this.sys.game.config.width / 2,
                this.sys.game.config.height / 2,
                "whatsInThePhoto"
              )
              .setOrigin(0.5, 0.5)
              .setAlpha(0);
            const scale = this.getScale(this.title, 0.9, false, "x");
            this.title.setScale(scale);
            this.tweens.add({
              targets: this.title,
              alpha: 1,
              ease: "Back",
              duration: 1000,
            });
          }

          addButton() {
            this.button = this.add
              .sprite(
                this.cameras.main.width / 2,
                this.cameras.main.height * 1.2,
                "tutorialBtn"
              )
              .setInteractive();
            const scale = this.getScale(this.button, 0.13, true, "y");
            this.button.setScale(scale).setScrollFactor(0);

            this.buttonText = this.add
              .text(
                this.cameras.main.width / 2,
                this.cameras.main.height * 1.2,
                "Next",
                {
                  font: "40px bold",
                  fill: "black",
                  align: "center",
                }
              )
              .setOrigin(0.5, 0.5);
            this.buttonText.setScale(scale).setScrollFactor(0);
            this.button.on("pointerdown", () => this.swipeTutorial());
            this.tweens.add({
              targets: [this.button, this.buttonText],
              y: this.cameras.main.height * 0.8,
              ease: "Back",
              duration: 1000,
              repeatDelay: 1000,
            });
          }

          swipeTutorial() {
            this.button.on("pointerdown", () => {});
            this.title.setAlpha(0);
            this.tweens.add({
              targets: this.bankRobber,
              alpha: 0.3,
              ease: "Linear",
              duration: 500,
            });

            this.tweens.add({
              targets: [this.button, this.buttonText],
              alpha: 0,
              ease: "Linear",
              duration: 500,
            });
            this.addFinger();
            this.showParts();
          }

          enableSwipe() {
            this.text = this.add
              .text(
                this.sys.game.config.width / 2,
                this.cameras.main.height / 4,
                "Swipe to\nchange face",
                {
                  font: "40px",
                  fill: "white",
                  align: "center",
                }
              )
              .setOrigin(0.5, 0.5);
            this.addSwipeBehavior();
          }

          endOfTutorial() {
            this.text.text = "You got it!\nLets play!";
            this.buttonText.text = "Play";
            this.button.on("pointerdown", () => this.scene.start("Game"));
            this.fadeParts();
            this.tweens.add({
              targets: this.finger,
              alpha: 0,
              ease: "Linear",
              duration: 1000,
            });
            this.bounceButton();
          }

          bounceButton() {
            this.tweens.add({
              targets: [this.button, this.buttonText],
              alpha: 1,
              ease: "Linear",
              duration: 1000,
            });
            this.tweens.add({
              targets: [this.button, this.buttonText],
              scale: this.button.scale * 1.5,
              ease: "Back",
              duration: 1000,
              yoyo: true,
              delay: 1000,
              repeat: 1,
            });
          }
        }
        class GameScene extends BaseGameScene {
          constructor() {
            super("Game");
            this.swipesLeft = 3;
          }

          update() {
            if (this.swipesLeft <= 0) {
              this.scene.launch("Final");
              this.scene.pause();
            }
          }
        }
        class FinalScene extends Phaser.Scene {
          constructor() {
            super("Final");
          }

          create() {
            this.addBlur();
            this.addIcon();
            this.addButton();
            console.log("Final loaded");
          }

          getScale(image, coeff = 1, cover = true, dimension = null) {
            const scaleX = this.cameras.main.width / image.width;
            const scaleY = this.cameras.main.height / image.height;
            if (dimension === "x") {
              return scaleX * coeff;
            } else if (dimension === "y") {
              return scaleY * coeff;
            } else {
              const mathFunc = cover ? Math.max : Math.min;
              return mathFunc(scaleX, scaleY) * coeff;
            }
          }

          addIcon() {
            const icon = this.add
              .image(
                this.cameras.main.width / 2,
                -(this.cameras.main.height / 6),
                "icon"
              )
              .setAngle(45);
            const scale = this.getScale(icon, 0.3, false);
            icon.setScale(scale).setScrollFactor(0);
            this.tweens.add({
              targets: icon,
              y: this.cameras.main.height / 6,
              angle: 0,
              ease: "Back",
              duration: 1000,
            });
          }

          addButton() {
            const button = this.add
              .sprite(
                this.cameras.main.width / 2,
                this.cameras.main.height * 1.2,
                "playNowBtn"
              )
              .setInteractive();
            const scale = this.getScale(button, 0.5, false, "x");
            button.setScale(scale).setScrollFactor(0);
            button.on("pointerdown", function (pointer) {
              window.open("http://google.com/");
            });
            this.tweens.add({
              targets: button,
              y: this.cameras.main.height / 1.2,
              ease: "Back",
              duration: 1000,
              repeatDelay: 1000,
              onComplete: () =>
                this.tweens.add({
                  targets: button,
                  scale: scale * 2,
                  ease: "Back",
                  duration: 1000,
                  yoyo: true,
                  delay: 1000,
                  repeat: 1,
                }),
            });
          }

          addBlur() {
            const rectangle = this.add
              .rectangle(
                0,
                0,
                this.cameras.main.width,
                this.cameras.main.height,
                "black"
              )
              .setOrigin(0, 0)
              .setAlpha(0);

            this.tweens.add({
              targets: rectangle,
              alpha: 0.8,
              ease: "Linear",
              duration: 500,
            });
          }
        }

        const initConfig = {
          type: Phaser.AUTO,
          width: window.innerWidth,
          height: window.innerHeight,
          scene: [PreloadScene, TutorialScene, GameScene, FinalScene],
          physics: {
            default: "arcade",
            arcade: {
              debug: false,
            },
          },
        };

        const game = new Phaser.Game(initConfig);
      }

      function adVisibleCallback(event) {
        console.log("isViewable " + event.isViewable);
        if (event.isViewable) {
          screenSize = dapi.getScreenSize();
          //START or RESUME the ad
        } else {
          //PAUSE the ad and MUTE sounds
        }
      }

      function adResizeCallback(event) {
        screenSize = event;
        console.log(
          "ad was resized width " + event.width + " height " + event.height
        );
      }

      //When user clicks on the download button - use openStoreUrl function
      function userClickedDownloadButton(event) {
        dapi.openStoreUrl();
      }

      function audioVolumeChangeCallback(volume) {
        let isAudioEnabled = !!volume;
        if (isAudioEnabled) {
          //START or turn on the sound
        } else {
          //PAUSE the turn off the sound
        }
      }
    </script>
  </body>
